import React, { useState } from 'react';
import { Route, Routes, Navigate } from 'react-router-dom';
import Login from '../superadmin/page/Login';
import Dashboard from '../superadmin/page/Dashboard';
import ManageDevice from '../superadmin/page/ManageDevice';
import ManageUsers from '../superadmin/page/ManageUsers';
import ManageUserRole from '../superadmin/page/ManageUserRole';
import ManageFinance from '../superadmin/page/ManageFinance';
import ManageReseller from '../superadmin/page/ManageReseller';
import Profile from '../superadmin/page/Profile';

const SuperAdminApp = () => {
  const storedUser = JSON.parse(sessionStorage.getItem('superAdminUser'));
  const [loggedIn, setLoggedIn] = useState(!!storedUser);
  const [userInfo, setUserInfo] = useState(storedUser || {});
  const [initialLoad, setInitialLoad] = useState(true);

  const handleLogin = (data) => {
    const { email, ...rest } = data;
    setUserInfo({ email, ...rest });
    setLoggedIn(true);
    sessionStorage.setItem('superAdminUser', JSON.stringify({ email, ...rest }));
  };

  const handleLogout = () => {
    setLoggedIn(false);
    setUserInfo({});
    sessionStorage.removeItem('superAdminUser');
  };

  const PrivateRoute = ({ path, element }) => {
    return loggedIn ? element : <Navigate to="/" />;
  };

  return (
    <Routes>
      <Route
        path="/"
        element={loggedIn ? <Navigate to="/Dashboard" /> : <Login handleLogin={handleLogin} />}
      />
      <PrivateRoute path="/Dashboard" element={<Dashboard userInfo={userInfo} handleLogout={handleLogout} />} />
      <PrivateRoute path="/ManageDevice" element={<ManageDevice userInfo={userInfo} handleLogout={handleLogout} />} />
      <PrivateRoute path="/ManageUsers" element={<ManageUsers userInfo={userInfo} handleLogout={handleLogout} />} />
      <PrivateRoute path="/ManageUserRole" element={<ManageUserRole userInfo={userInfo} handleLogout={handleLogout} />} />
      <PrivateRoute path="/ManageFinance" element={<ManageFinance userInfo={userInfo} handleLogout={handleLogout} />} />
      <PrivateRoute path="/ManageReseller" element={<ManageReseller userInfo={userInfo} handleLogout={handleLogout} />} />
      <PrivateRoute path="/Profile" element={<Profile userInfo={userInfo} handleLogout={handleLogout} />} />
    </Routes>
  );
};

export default SuperAdminApp;
